using Microsoft.EntityFrameworkCore;
using Psinder.DB.Common.Extensions;
using Microsoft.AspNetCore.Http;

namespace Psinder.DB.Common.Entities;

public class File
{
    public long Id { get; set; }

    public string Name { get; set; }

    public string Extension { get; set; }

    public long ContentLength { get; set; }

    public string ContentType { get; set; }

    public byte[] Content { get; set; }

    public static void SetEntity(ModelBuilder builder)
    {
        ConfigureEntity(builder);
        SeedEntity(builder);
    }

    public static void ConfigureEntity(ModelBuilder builder)
    {
        builder.Entity<File>(b =>
        {
            b.ToTable("files");
            b.HasKey(x => x.Id);
            b.Property(x => x.Name)
                .HasColumnName("name")
                .HasColumnType("varchar")
                .IsRequired()
                .HasComment("File name.")
                .HasMaxLength(128);
            b.Property(x => x.Extension)
                .HasColumnName("extension")
                .HasColumnType("varchar")
                .IsRequired()
                .HasComment("File extension.")
                .HasMaxLength(32);
            b.Property(x => x.ContentType)
                .HasColumnName("content_type")
                .HasColumnType("varchar")
                .IsRequired()
                .HasComment("File content type.")
                .HasMaxLength(64);
            b.Property(x => x.ContentLength)
                .HasColumnName("content_length")
                .HasColumnType("bigint")
                .IsRequired()
                .HasComment("File content length.");
            b.Property(x => x.Content)
                .HasColumnName("content")
                .HasColumnType("image")
                .IsRequired()
                .HasComment("File content.");
        });
    }

